import React from "react";
import '../bootstrap/bootstrap.css';
import './Landing.css';
import logo from './image/logo.jpg';
import imageMenu from './image/meet.jpg';
import { Footer } from "../Footer/Footer";
import {  useNavigate } from "react-router-dom";

export function Landing() {

   const navigate = useNavigate();

    return (
    <>
      <div className="contain">

        <div className="Navbar">
         <nav class="navbar navbar-expand-sm bg-light navbar-light">
          <div className="logo"><img src={logo} className="logo"/></div>
          <div className="btn2"><button type="btn" className="btn btn-outline-primary" onClick={()=>navigate('/login')} >Log In</button></div>
         </nav>
        </div>

        <div className="HomePageContainer">
          <div className="Title1"><h1>WELCOME TO MYCALENDAR-MEET</h1></div>
          <div className="HomePage">
          <div className="banner-text">
             <h5>Êtes-vous dans le monde professionnel?</h5><br />
             <h5>Vous voulez gérer votre rendez-vous professionelle plus facilement?</h5><br />
             <h4>Ou bien, vouloir fixer un rendez-vous dans une entreprise sans devoir se déplacer?</h4>
             <h5></h5>
          </div>
          <div className="imageMenu"><img src={imageMenu}/></div>
          </div>
        </div>

        <Footer/>
      </div> 
      </>
    )
}
